import React from 'react';
import { useOutletContext } from 'react-router-dom';

function Home() {
  const { 
    listNames,
    setFullNames,
    conditionalNames,
    setConditionalNames
  } = useOutletContext();

  return (
    <>
      <input
        type='text'
        placeholder='search person'
        value={null}
      />

      <br/>

      <small>{listNames()}</small>

      <small className="bottom" id="glass">
        Home
      </small>
    </>
  );
}

export default Home;
